import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div className="text-center">
      <h1 className="text-4xl font-bold mb-6">Welcome to Donation App</h1>
      <p className="text-xl mb-8">Make a difference with your donations</p>
      <div className="space-x-4">
        <Link
          to="/donate"
          className="bg-blue-600 text-white px-6 py-3 rounded-md text-lg font-medium hover:bg-blue-700"
        >
          Donate Now
        </Link>
        <Link
          to="/register"
          className="bg-gray-600 text-white px-6 py-3 rounded-md text-lg font-medium hover:bg-gray-700"
        >
          Register
        </Link>
      </div>
    </div>
  );
};

export default Home;
